@KariWardle @MJMadda In my experience, 90% of parents aren’t sufficiently financially literate to run their own lives, let alone teach it. 

And the 10% who might be are already better off, extending issues. 

This can only change at school (but with teachers incentivised to do so)

@elsnakeob @MJMadda I’d partially agree. 

It isn’t the only reason, definitely. But many rich and middle class people are so and remain so due to financial literacy. 

Universal finlit would be the lowest cost (if only partial) rebalancing.

@geostylegeo Tolerance and bigotry are not opposites. 

You can be open-minded and intolerant. 
You can be bigoted and tolerant.

